    const { product } = props;
    return(
        <section className="newone">
                <div className="col-xl-3 col-lg-3 col-md-3 col-sm-6 col-6">
                <div className="card text-center card-product">
                    <div className="card-product__img">
                        <img src="" alt="Product image"/>
                        <div className="favorit-items">
                            <i className="ti ti-heart"></i>
                        </div>
                    </div>
                    <div>
                        <h4 className="card-product__title"><a href="#">jbjbjbjbkjbjbjhb</a></h4>
                        <p className="card-product__price"><span className="cross"><del>njnj
                        </del></span>&nbsp;&nbsp;mkk</p>
                    </div>
                </div>
            </div>
        </section>
    );
}
export default Newone;
